import React from 'react';
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';

function CalendarComponent() {
  return (
    <div className="calendar-component">
      <h2>Calendar</h2>
      <Calendar />
    </div>
  );
}

export default CalendarComponent;
